import React, { useState } from 'react';
import { Scrollbars } from 'react-custom-scrollbars';
import CardData from './CardData';
import AllData from "./AllData";

const Cards = () => {
    const [data, setData] = useState("AllData");
    return (
        <>
            <header>
                <div className="shoping_container">
                    <div className="arrow_icon">
                        <img src="../image/arrow.png" alt="" className="arrow" />
                        <h1 className="sk-heading">Sk Techn Mobile</h1>
                    </div>
                    <div className="cresh_icon">
                        <i className="fas fa-cart-plus fa-2x crshIcon">
                            <span className="counting">7</span>
                        </i>
                    </div>
                </div>
                <br />
            </header>
            <section className="shoping-heading">
                <h1 className="shoping-title">Shopping Cart</h1>
                <p className="shoping-pera">
                    You Have <span className="card-cnt">7</span> Item In Shoing Cart
                </p>
                <br />
                <div className="shoping-section">
                    <Scrollbars >
                    {
                        data.map((crntVal) =>{
                            return  <CardData  key={crntVal} {...crntVal}/>
                        })
                    }
                       
                    </Scrollbars>
                </div>
            </section>
        </>
    )
}

export default Cards;
